import React from "react";
import { StyleSheet, View, Image, TouchableOpacity, Text } from "react-native";
import { FontAwesome, Entypo } from "@expo/vector-icons";

function OnlineOrderHome(props) {
  return (
    <View style={styles.container}>
      <View style={styles.logoGroup}>
        <Image
          source={require("./assets/images/dpos-logo-white.png")}
          resizeMode="contain"
          style={styles.logo}
        ></Image>
        <Image
          source={require("./assets/images/image_ridw..png")}
          resizeMode="contain"
          style={styles.dash}
        ></Image>
      </View>
      <View style={styles.btnContainerRow}>
        <TouchableOpacity style={styles.pickupBtn}>
          <Text style={styles.pickupBtnTxt}>PICK UP</Text>
        </TouchableOpacity>
        <TouchableOpacity style={styles.deliveryBtn}>
          <Text style={styles.deliveryBtnTxt}>DELIVERY</Text>
        </TouchableOpacity>
      </View>
      <View style={styles.bottomRowGroup}>
        <View style={styles.detailsLocationGroup}>
          <View style={styles.phoneNumberRow}>
            <FontAwesome
              name="phone"
              style={styles.phoneNumberIcon}
            ></FontAwesome>
            <Text style={styles.phoneNumberTxt}>(226) 600-5925</Text>
          </View>
          <View style={styles.addressRow}>
            <Entypo name="location-pin" style={styles.addressIcon}></Entypo>
            <Text style={styles.addressTxt}>
              32 Sunrise Drive,{"\n"}Kitchener, Ontario
            </Text>
          </View>
        </View>
        <View style={styles.socialIconsGroup}>
          <Image
            source={require("./assets/images/image_pDaA..png")}
            resizeMode="contain"
            style={styles.facebookIcon}
          ></Image>
          <Image
            source={require("./assets/images/image_CLpi..png")}
            resizeMode="contain"
            style={styles.instagramIcon}
          ></Image>
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "rgba(30,30,30,1)",
    alignItems: "center",
    justifyContent: "space-between",
  },
  logoGroup: {
    height: 80,
    padding: 10,
    justifyContent: "space-between",
    alignSelf: "flex-start",
  },
  logo: {
    width: 237,
    height: 66,
  },
  dash: {
    height: 25,
    width: "50%",
  },
  btnContainerRow: {
    flexDirection: "row",
    width: 683,
    justifyContent: "space-between",
  },
  pickupBtn: {
    width: 219,
    height: 60,
    backgroundColor: "rgba(238,125,67,1)",
    borderRadius: 60,
    justifyContent: "center",
    alignItems: "center",
    shadowColor: "rgba(0,0,0,1)",
    shadowOffset: {
      width: 3,
      height: 3,
    },
    elevation: 30,
    shadowOpacity: 0.2,
    shadowRadius: 10,
  },
  pickupBtnTxt: {
    color: "rgba(255,255,255,1)",
    fontSize: 18,
    fontWeight: "700",
  },
  deliveryBtn: {
    width: 219,
    height: 60,
    backgroundColor: "rgba(238,125,67,1)",
    borderRadius: 60,
    justifyContent: "center",
    alignItems: "center",
    shadowColor: "rgba(0,0,0,1)",
    shadowOffset: {
      width: 3,
      height: 3,
    },
    elevation: 30,
    shadowOpacity: 0.2,
    shadowRadius: 10,
  },
  deliveryBtnTxt: {
    color: "rgba(255,255,255,1)",
    fontSize: 18,
    fontWeight: "700",
  },
  bottomRowGroup: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "flex-end",
    alignSelf: "stretch",
  },
  detailsLocationGroup: {
    justifyContent: "center",
    margin: 10,
  },
  phoneNumberRow: {
    width: 231,
    height: 65,
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
  },
  phoneNumberIcon: {
    color: "rgba(255,255,255,1)",
    fontSize: 50,
  },
  phoneNumberTxt: {
    color: "rgba(255,255,255,1)",
    fontSize: 25,
    fontWeight: "500",
  },
  addressRow: {
    width: 231,
    height: 65,
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
  },
  addressIcon: {
    color: "rgba(255,255,255,1)",
    fontSize: 50,
  },
  addressTxt: {
    color: "rgba(255,255,255,1)",
    fontSize: 23,
  },
  socialIconsGroup: {
    width: 190,
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    margin: 10,
  },
  facebookIcon: {
    height: 57,
    width: 72,
  },
  instagramIcon: {
    height: 57,
    width: 72,
  },
});

export default OnlineOrderHome;
